class Homepage extends Component{
  render(){
    return(
      <div id="container">
        <div class="homepage_image" >
          <h1>ברוכים הבאים</h1>
          <h1> למזון שפיים</h1>
        </div>
        <div>הודעות</div>

      </div>
    );
    }
  }

class App extends Component{
  render (){
    return(
      <div>
        <div>
          <Navigation></Navigation>
        </div>
        <div>
          <Homepage></Homepage>
        </div>
    </div>
    )
  }
}

export default App;
